import React from "react";
import styled from "styled-components";


const CompletedDiv = styled.li`
  text-decoration: ${props => props.completed ? "line-through" : ""};
`;

const Track = ({ track, handleToggle }) => {

  const handleClick = (e) => {
    e.preventDefault()
    handleToggle(e.currentTarget.id)
  }
  return (

    <CompletedDiv id={track.number} completed={false} name="track" key={track.number + track.title} onClick={handleClick}>
      {track.title}
    </CompletedDiv>

  );
};

export default Track;
